import "./App.scss";

const numberOfFields = 5;

const matrix = Array.from({ length: numberOfFields }, () =>
  Array.from({ length: numberOfFields }, () => ({
    id: Math.random() * 100,
  }))
);

console.log(matrix);

function App() {
  return (
    <div className="App">
      <h1>Hello matrix</h1>

      <div>{matrix.map((item) => item.id)}</div>
    </div>
  );
}

export default App;
